import './App.css';
import Cabecalho from './components/Cabecalho';
import Container from './components/container';
import Titulo from './components/Título';
import Rodape from './components/Rodapé';
import Tabela from './components/Tabela';
import useDadosConsulta from './useDadosConsulta';
import Grafico from './components/Gráfico';
import useDadosProfissional from './useDadosProfissional';
import Avaliacao from './components/Avaliacao';
import Botao from './components/Botao';
import consulta from './components/Título/assets/consulta.png';

function App() {
  const { dados: consultas, erro: consultasErro } = useDadosConsulta();
  const { dados: profissionais, erro: profissionaisErro } = useDadosProfissional();

  if (consultasErro || profissionaisErro) {
    console.log("Ocorreu um erro ao buscar os dados");
  }
  return (
    <>
      <Cabecalho />
      <Container>
        <Titulo>Área administrativa</Titulo>
        <Botao>Cadastrat especialista</Botao>
        <Titulo imagem={consulta}>Consultas do dia</Titulo>
        <Tabela consultas={consultas} />
        <Grafico consultas={consultas} profissionais={profissionais} />
        <Avaliacao profissionais={profissionais} />
      </Container>
      <Rodape />
    </>
  );
}

export default App;
